package simbigraph.delaune;

public class DelanuneyAgent {
	double x, y;

	public void setX(double x) {
		this.x = x;
	}

	public void setY(double y) {
		this.y = y;
	}

	public DelanuneyAgent(double xx, double yy) {
		x=xx;y=yy;
	}

	public double getY() {
		// TODO Auto-generated method stub
		return y;
	}

	public double getX() {
		// TODO Auto-generated method stub
		return x;
	}

}
